import steem from "@ericet/steem-js";
import { QRCodeStyling, browserUtils } from "./qr";

class SteemPaperWallet {
    constructor(username, legalname) {
        this.username = username;
        this.legalname = legalname;
        this.keys = {};
    }

    async generateKeys() {
        // Generate a master password
        const masterPassword = steem.formatter.createSuggestedPassword();

        // Convert the password to a master private key (WIF format)
        this.keys.masterPrivateKey = steem.auth.toWif(this.username, masterPassword, 'owner');

        // Generate public keys for all roles using the master private key
        this.keys.publicKeys = steem.auth.generateKeys(this.username, this.keys.masterPrivateKey, ['owner', 'active', 'posting', 'memo']);
    }

    async createPaperWalletImage() {
        // Create the canvas element
        const canvas = document.createElement("canvas");
        canvas.width = 3555;
        canvas.height = 1155;
        const ctx = canvas.getContext("2d");

        // Fill background with a solid color
        ctx.fillStyle = "#ffffff";
        ctx.fillRect(0, 0, canvas.width, canvas.height);
        const baseIMG = new Image();
        baseIMG.onload = async () => {
            // Draw the QR code on the canvas
            this.addImageToWallet(ctx, baseIMG, 0, 0, 3250, 1125);

            // Add the username
            this.addTextToWallet(ctx, `${this.legalname}`, 1864, 450, '#ffffff', '64px Industry');

            // Add the username
            this.addTextToWallet(ctx, `@${this.username}`, 1864, 594, '#ffffff', '96px Industry');

            // Add the master private key
            this.addTextToWallet(ctx, `${this.keys.masterPrivateKey.slice(0, 26)}`, 800, 812, '#000334', '22px Industry');
            this.addTextToWallet(ctx, `${this.keys.masterPrivateKey.slice(26, 52)}`, 800, 812+36, '#000334', '22px Industry');

            // Generate the QR code
            const opts = {
                data: this.keys.masterPrivateKey,
                dotsOptions: {
                    color: "#000e38",
                    type: "square"
                },
                cornersSquareOptions: {
                    type: "square",
                    color: "#000e38"
                },
                cornersDotOptions: {
                    type: "square"
                },
                qrOptions: {
                    errorCorrectionLevel: "Q"
                },
                backgroundOptions: false
            };
            const qrCode = new QRCodeStyling(opts);
            // Convert QR code to an image
            qrCode.serialize().then((xml) => {
                if (!xml) return;
                const svg64 = btoa(xml);
                const image64 = "data:image/svg+xml;base64," + svg64;
                const image = new Image();

                image.onload = () => {
                    // Ensure pixel-perfect rendering of SVG to avoid artefact, then downscale to requested size
                    this.addImageToWallet(ctx, image, 800, 370, 350, 350);

                    const link = document.createElement("a");
                    link.download = `${this.username}-private.png`;
                    link.href = canvas.toDataURL("image/jpeg");
                    link.click();

                };
                image.src = image64;

            });
        }
        baseIMG.src = "data:image/webp;base64,";
    }

    createJSONFile() {
        // Create a JSON object with the public keys
        const jsonData = {
            username: this.username,
            legalName: this.legalname, // Example, replace with real name if needed
            publicKeys: this.keys.publicKeys
        };

        // Display the JSON data
        const jsonString = JSON.stringify(jsonData, null, 2);
        const blob = new Blob([jsonString], { type: "application/json" });
        const url = URL.createObjectURL(blob);
        const link = document.createElement("a");
        link.download = `${this.username}-public.json`;
        link.href = url;
        link.textContent = "Download Public JSON";
        link.click();
    }

    addImageToWallet(ctx, image, x, y, width, height) {
        ctx.drawImage(image, 0, 0, image.naturalWidth || image.width, image.naturalHeight || image.height, x, y, width || image.naturalWidth || image.width, height ||  image.naturalHeight || image.height);
    }

    addTextToWallet(ctx, text, x, y, color, font) {
        ctx.font = font;
        ctx.fillStyle = color;
        ctx.fillText(text, x, y);
    }
}

module.exports = SteemPaperWallet;